})

$customG.Add_Click({
     Add-Type -AssemblyName System.Windows.Forms
     $OpenFileDialog = New-Object System.Windows.Forms.OpenFileDialog
     $OpenFileDialog.Filter = 'Image Files (*.png;*.jpg)|*.png;*.jpg'
     $OpenFileDialog.Multiselect = $false
     $response = $OpenFileDialog.ShowDialog( ) # $response can return OK or Cancel
     if ( $response -eq 'OK' ) {
     Set-Location $env:APPDATA"\GIMP\2.10\splashes" | Out-Host
     Get-ChildItem  $env:APPDATA"\GIMP\2.10\splashes" -Include *.* -Recurse | foreach { $_.Delete()} | Out-Host
     Copy-Item $OpenFileDialog.FileName $env:APPDATA"\GIMP\2.10\splashes"
     [System.Windows.Forms.MessageBox]::Show( "Your custom image has been applied ", "Installation completed", "OK", "Information" )
     }
})

$install.Add_Click({
     Write-Host "Installing SplashSetter..."
     Set-Location $env:APPDATA | Out-Host
     New-Item $env:APPDATA"\SplashSetter" -ItemType directory | Out-Host
     Invoke-WebRequest -Uri "https://raw.githubusercontent.com/Hoseasack/SplashSetter/main/SplashSetter.ps1" -OutFile $env:APPDATA"\SplashSetter\SplashSetter.exe" -UseBasicParsing | Out-Host
     $WshShell = New-Object -comObject WScript.Shell
     $Shortcut = $WshShell.CreateShortcut("$Home\Desktop\SplashSetter.lnk")
     $Shortcut = $WshShell.CreateShortcut("$env:APPDATA\Microsoft\Windows\Start Menu\Programs\SplashSetter.lnk")
     $Shortcut.TargetPath = "$env:APPDATA\SplashSetter\SplashSetter.exe"
     $Shortcut.Save()
     [System.Windows.Forms.MessageBox]::Show( "SplashSetter been installed successfully ", "Installation completed", "OK", "Information" )
})

